    private void allDownloaded(final View view){
        Out.println(this, "All images were succesfuly completed");
        final ScrollView scrollView = findViewById(R.id.scrollViewContent);
        new Thread() {
            public void run() {
                runOnUiThread(new Runnable() {
                    @Override
                    public void run() {
                        scrollView.removeAllViews(); scrollView.addView(view);
                    }
                });
            }
        }.start();
//        Toast.makeText(this, "All images were succesfuly completed", Toast.LENGTH_LONG).show();
    }

    private void addLinLayout(LinearLayout where, int layer){
        LinearLayout nextLayer = LayoutBuilder.getLinearLayout(this);
        where.addView(nextLayer);
        nextLayer.addView(LayoutBuilder.getBasicTextView(this, "Some random text in layer "+layer+"."));
        if(layer > 0) addLinLayout(nextLayer, layer-1);
    }

    public static void addToView(final View what, final ViewGroup where){
        new Thread() {
            public void run() {
                instance.runOnUiThread(new Runnable() {
                    @Override
                    public void run() {
                        where.addView(what);
                    }
                });
            }
        }.start();
    }

    public static void replaceTextOfView(final SpannableString ss, final TextView where){
        new Thread() {
            public void run() {
                instance.runOnUiThread(new Runnable() {
                    @Override
                    public void run() {
                        where.setText(ss);
                    }
                });
            }
        }.start();
    }

    public static void replaceImageBitmap(final Bitmap decodedByte, final ImageView imageView) {
        new Thread() {
            public void run() {
                instance.runOnUiThread(new Runnable() {
                    @Override
                    public void run() {
                        imageView.setImageBitmap(decodedByte);
                    }
                });
            }
        }.start();
    }

